pragma solidity 0.4.24;

contract StoreContract {
    string public constant version = "0722";

    // --- Constructor & Owner ---
    address public _owner;
    address public newOwner;

    modifier onlyOwner {
        require(msg.sender == _owner);
        _;
    }

    modifier onlyNewOwner {
        require(msg.sender == newOwner);
        _;
    }

    constructor() public {
        _owner = msg.sender;
    }

    function nextOwner(address _newOwner) public onlyOwner {
        newOwner = _newOwner;
    }

    function changeOwner() public onlyNewOwner {
        _owner = newOwner;
        newOwner = address(0);
    }

    // --- Total history ---
    enum Action { Staking, Unstaking }
    enum State { Unknown, Transferred, Canceled }

    struct Record {
        Action action;
        address cn;
        uint time;
        uint amount;
        State state;
        uint due;
    }

    mapping(address => uint) public historyCount;
    mapping(address => mapping(uint => Record)) public history;

    struct RecordIdx {
        address user;
        uint idx;
    }

    mapping(address => mapping(uint => RecordIdx)) public unstakingMap;

    mapping(address => uint) public deposit;  // Token

    mapping(address => uint) public totalIn;  // Klay
    mapping(address => uint) public totalOut;  // Klay

    mapping(address => uint) public sTotalIn;  // Token
    mapping(address => uint) public sTotalOut;  // Token

    struct SubRecord {
        Action action;
        uint time;
        uint amount;
        State state;
        uint due;
    }

    mapping(address => mapping(address => uint)) public subHistoryCount;
    mapping(address => mapping(address => mapping(uint => SubRecord))) public subHistory;

    struct Unstaking {
        address user;
        uint amount;  // Klay
        uint due;
        State state;
        uint idx;  // connect to history
    }

    mapping(address => uint) public lastUid;
    mapping(address => mapping(uint => Unstaking)) public unstakingList;

    mapping(address => uint) public pending;  // Klay
    uint public totalPending;  // Klay

    mapping(address => bool) public usedUser;
    address[] public usedUserList;

	mapping(address => mapping(address => uint)) public extraAddrAddrInt1;
	mapping(address => mapping(address => uint)) public extraAddrAddrInt2;
	mapping(address => mapping(address => uint)) public extraAddrAddrInt3;
	mapping(address => mapping(address => uint)) public extraAddrAddrInt4;
	mapping(address => uint) public extraAddrIntMap1;
	mapping(address => uint) public extraAddrIntMap2;
	mapping(address => uint) public extraAddrIntMap3;
	mapping(address => uint) public extraAddrIntMap4;
	uint public extraInt1;
	uint public extraInt2;
	uint public extraInt3;
	uint public extraInt4;
	address public extraAddr1;
	address public extraAddr2;
	address public extraAddr3;
	address public extraAddr4;

    // --- Math ---
    function add(uint a, uint b) private pure returns (uint) {
        require(a <= uint(-1) - b);
        return a + b;
    }

    function sub(uint a, uint b) private pure returns (uint) {
        require(a >= b);
        return a - b;
    }

    // --- Supersetters ---
    function setHistoryCount(address user, uint cnt) public onlyOwner {
        historyCount[user] = cnt;
    }

    function setHistory(address user, uint idx, uint action, address cn, uint time, uint amount, uint state, uint due) public onlyOwner {
        history[user][idx] = Record(Action(action), cn, time, amount, State(state), due);
    }

    function setHistoryState(address user, uint idx, uint state) public onlyOwner {
        history[user][idx].state = State(state);
    }

    function setUnstakingMap(address cn, uint uid, address user, uint idx) public onlyOwner {
        unstakingMap[cn][uid] = RecordIdx(user, idx);
    }

    function setDeposit(address user, uint tokenAmount) public onlyOwner {
        deposit[user] = tokenAmount;
        _addUser(user);
    }

    function setTotalIn(address user, uint amount) public onlyOwner {
        totalIn[user] = amount;
    }

    function setTotalOut(address user, uint amount) public onlyOwner {
        totalOut[user] = amount;
    }

    function setSTotalIn(address user, uint tokenAmount) public onlyOwner {
        sTotalIn[user] = tokenAmount;
    }

    function setSTotalOut(address user, uint tokenAmount) public onlyOwner {
        sTotalOut[user] = tokenAmount;
    }

    function setSubHistoryCount(address cn, address user, uint cnt) public onlyOwner {
        subHistoryCount[cn][user] = cnt;
    }

    function setSubHistory(address cn, address user, uint idx, uint action, uint time, uint amount, uint state, uint due) public onlyOwner {
        subHistory[cn][user][idx] = SubRecord(Action(action), time, amount, State(state), due);
    }

    function setSubHistoryState(address cn, address user, uint idx, uint state) public onlyOwner {
        subHistory[cn][user][idx].state = State(state);
    }

    function setLastUid(address cn, uint uid) public onlyOwner {
        lastUid[cn] = uid;
    }

    function setUnstakingList(address cn, uint uid, address user, uint amount, uint due, uint state, uint idx) public onlyOwner {
        unstakingList[cn][uid] = Unstaking(user, amount, due, State(state), idx);
    }

    function setUnstakingListState(address cn, uint uid, uint state) public onlyOwner {
        unstakingList[cn][uid].state = State(state);
    }

    function setPending(address user, uint amount) public onlyOwner {
        pending[user] = amount;
    }

    function setTotalPending(uint amount) public onlyOwner {
        totalPending = amount;
    }

    function setExtraAddrAddrInt1(address key1, address key2, uint value) public onlyOwner {
        extraAddrAddrInt1[key1][key2] = value;
    }
	function setExtraAddrAddrInt2(address key1, address key2, uint value) public onlyOwner {
        extraAddrAddrInt2[key1][key2] = value;
    }

	function setExtraAddrAddrInt3(address key1, address key2, uint value) public onlyOwner {
        extraAddrAddrInt3[key1][key2] = value;
    }

	function setExtraAddrAddrInt4(address key1, address key2, uint value) public onlyOwner {
        extraAddrAddrInt4[key1][key2] = value;
    }

    function setExtraAddrIntMap1(address key, uint value) public onlyOwner {
        extraAddrIntMap1[key] = value;
    }

	function setExtraAddrIntMap2(address key, uint value) public onlyOwner {
        extraAddrIntMap2[key] = value;
    }

	function setExtraAddrIntMap3(address key, uint value) public onlyOwner {
        extraAddrIntMap3[key] = value;
    }

	function setExtraAddrIntMap4(address key, uint value) public onlyOwner {
        extraAddrIntMap4[key] = value;
    }

    function setExtraInt1(uint value) public onlyOwner {
        extraInt1 = value;
    }

	function setExtraInt2(uint value) public onlyOwner {
        extraInt2 = value;
    }

	function setExtraInt3(uint value) public onlyOwner {
        extraInt3 = value;
    }

	function setExtraInt4(uint value) public onlyOwner {
        extraInt4 = value;
    }

	function setExtraAddress1(address value) public onlyOwner {
        extraAddr1 = value;
    }

	function setExtraAddress2(address value) public onlyOwner {
        extraAddr2 = value;
    }

	function setExtraAddress3(address value) public onlyOwner {
        extraAddr3 = value;
    }

	function setExtraAddress4(address value) public onlyOwner {
        extraAddr4 = value;
    }

    // --- Getters ---
    function getUnstakingMap(address cn, uint uid) public view returns (address, uint){
        RecordIdx memory rid = unstakingMap[cn][uid];
        return (rid.user, rid.idx);
    }

    function getUnstakingList(address cn, uint uid) public view returns (address, uint, uint, uint, uint) {
        Unstaking memory u = unstakingList[cn][uid];
        return (u.user, u.amount, u.due, uint(u.state), u.idx);
    }

    function getHistory(address user, uint idx) public view returns (uint, address, uint, uint, uint, uint) {
        Record memory r = history[user][idx];
        return (uint(r.action), r.cn, r.time, r.amount, uint(r.state), r.due);
    }

    function getSubHistory(address cn, address user, uint idx) public view returns (uint, uint, uint, uint, uint) {
        SubRecord memory r = subHistory[cn][user][idx];
        return (uint(r.action), r.time, r.amount, uint(r.state), r.due);
    }

    function getUserListLength() public view returns (uint){
        return usedUserList.length;
    }

    function _addUser(address user) private{
        if(!usedUser[user]){
            usedUser[user] = true;
            usedUserList.push(user);
        }
    }
}
